import React from "react";
import './index.css';
import Navbar from "./Navbar";
import Notes from "./Notes";
import ShowNote from "./ShowNote";
function App() {
  return (
    <div className="App">
      <Navbar />
      <Notes />
      <ShowNote />
    </div>
  );
}

export default App;
